CREATE TABLE `audit_trail` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `audit_action` varchar(455) NOT NULL DEFAULT '',
  `audit_date` varchar(105) NOT NULL DEFAULT '',
  `audit_user` varchar(105) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10973 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `cart` (
  `cart_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `location_name` varchar(15) NOT NULL,
  `location_type` varchar(15) NOT NULL,
  `location_status` varchar(10) NOT NULL,
  PRIMARY KEY (`cart_id`)
) ENGINE=InnoDB AUTO_INCREMENT=22 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `category` (
  `category_id` int(4) unsigned NOT NULL AUTO_INCREMENT,
  `category_name` varchar(25) NOT NULL,
  PRIMARY KEY (`category_id`)
) ENGINE=InnoDB AUTO_INCREMENT=22 DEFAULT CHARSET=utf8mb4;



CREATE TABLE `customer` (
  `customer_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `customer_name` varchar(45) NOT NULL,
  `customer_contactno` varchar(45) NOT NULL,
  `customer_address` varchar(100) NOT NULL,
