  `received_by` varchar(45) DEFAULT NULL,
  `deliver_img` text DEFAULT NULL,
  `delivery_location` text DEFAULT NULL,
  PRIMARY KEY (`slip_id`)
) ENGINE=InnoDB AUTO_INCREMENT=85 DEFAULT CHARSET=utf8mb4;

